import React from 'react';
import {HashLink as Link} from "react-router-hash-link";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Pic from "../img/geburtsvorbereitung_details.jpg";
import Pic_slim from "../img/geburtsvorbereitung_details_slim.jpg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    height: 'auto',
    '& > *': {
      width: '80%',
      margin: '3% auto 5% auto',
      color: '#383e56',
      backgroundColor: 'white',
      backgroundImage: 'url("https://www.transparenttextures.com/patterns/soft-wallpaper.png");',
    },
  },
}));

export default function Paper3() {
  const classes = useStyles();
  window.scrollTo(0, 0);

  return (
    <div className={classes.root}>
      <Paper
        elevation={20}
        children={
          <div>
            <div>
              <div className="row">
                <div className="col-12">
                  <img src={Pic_slim} className="paper-img-style-slim" alt="geburtsvorbereitung" />
                </div>
                <div className="col-12 paper-text-style-slim">
                  <h1 className="paper-header">Geburtsvorbereitungskurs</h1>
                  <hr className="hr-duck" />
                  <p>
                    Bei einem privaten Geburts-Vorbereitungskurs, alleine oder mit deinem Partner/deiner Partnerin können wir gezielt auf deine Fragen eingehen.
                  </p>
                  <p>
                    Wir besprechen Themen wie die letzten Wochen der Schwangerschaft, Geburt, Wochenbett und Stillbeginn. Auch Wehen- und Atemübungen und Unterstützungsmöglichkeiten von Seitens des Partners finden hier Platz.
                  </p>
                  <br />
                  <p>
                    <strong>Kosten: 240 Euro</strong>
                  </p>
                  <div className="arrow-div">
                    <Link to="/services/#leistung3" ><i className="fa fa-arrow-left" /></Link>
                  </div>
                </div>
                <div className="col-lg-8 col-md-6 paper-text-style">
                <h1 className="paper-header">Geburtsvorbereitungskurs</h1>
                <hr className="hr-duck" />
                <p>
                  Bei einem privaten Geburtsvorbereitungskurs, alleine oder mit deinem Partner/deiner Partnerin können wir gezielt auf deine Fragen eingehen.
                </p>
                <p>
                  Wir besprechen Themen wie die letzten Wochen der Schwangerschaft, Geburt, Wochenbett und Stillbeginn. Auch Wehen- und Atemübungen und Unterstützungsmöglichkeiten von Seiten des Partners finden hier Platz.
                </p>
                <br />
                <p>
                  <strong>Kosten: 240 Euro</strong>
                </p>
                </div>
                <div className="col-lg-4 col-md-6 paper-col-img-style">
                  <img src={Pic} alt="Probe" className="paper-img-style"/>
                </div>
              </div>
            </div>
          </div>
        }
      />
    </div>
  );
}
